import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Home from './Pages/Home';
import Eco from './Pages/Eco';
import Road from './Pages/Road';
import VerticalMode from "./slider";

function App() {
  return (
  <>
  <Header />
  <Home />
  <Eco></Eco>
  <Road></Road>
  <VerticalMode/>
  <Footer />
  </>
  );
}

export default App;
